    this.state ={
      photos: [],
      isLoaded: false,
      error: null
    };
  }

  componentDidMount() {
    fetch('https://graph.instagram.com/me?fields=id,username&access_token=IGQVJXb0RreTNGbEFjNk9aQWZAQYnlGV3NGc3RMX1NYYzhKcUJCRVBwWUVzc0xSc0t2VmU0T2tGdDRHTURXTkYtM0dtaVdCM2FocmpicTRvLTZAWci14OHlfRjVpUjNHQnhQZAzIxaDROMVJPQ2xDUEhkbAZDZD')
    .then(response => {
